import React from 'react';
import logo from '../images/logo.png';

function Navbar() {
  return (
  <div className='nav'>
      <img 
      className='nav-logo'
      src={logo}
      /> 

      <img
      className='nav-avatar'
      src="https://upload.wikimedia.org/wikipedia/commons/0/0b/Netflix-avatar.png"

      />
  </div>
  )
}

export default Navbar;
